import './App.css';
import axios from 'axios';
import React, { useState, useEffect } from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
function App() {
  const table_header = ["date","trade_code","high","low","open","close","volume"];
  const [data, setData] = useState([]);
  useEffect(()=>{
    axios
    .get("http://127.0.0.1:8000/stock/")
    .then((res)=>{
      setData(res.data);
    })
    .catch((err) => {
      console.error(err);
    })
  },[]);
  const handleInputChange = (event, index, key) => {
    const updatedData = [...data];
    updatedData[index][key] = event.target.value;
    setData(updatedData);
  };
  return (
    <div className="App">
      <h2 className='App-header'>Stock Market Data</h2>
      <div className='container'>
      <table className='table'>
        <thead>
          <tr>
            {table_header.map((item, index)=>(
                <th key={index}>{item}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          {data.map((detail, id)=>(
            <tr key={id}>
              {table_header.map((value, id2)=>(
                <td key={id2}>{detail[value]}</td>
              ))}
            </tr>
          ))}
        </tbody>
      </table>

    </div>
    </div>
  );
}

export default App;
